    animation-delay: 1.8s;

// animations

@keyframes India--blink {
  0% {
    fill: white;
  }
  50% {
    fill: #FF4159;
  }
  100% {
    fill: #FF4159;
  }
}

@keyframes India--float-away {
  0% {
    transform: translateY(0px);
    opacity: 0;
  }
  
  10% {
    transform: translateY(0px);
    opacity: 1;
  }
  
  40% {
    transform: translateY(0px);
    opacity: 1;
  }
  
  60% {
    transform: translateY(-50px);
    opacity: 0;
  }
  
  100% {
    transform: translateY(-50px);
    opacity: 0;
  }
}



#myImg {

#myImg:hover {opacity: .7;}

/* The Modal (background) */
.modal {
    display: none; /* Hidden by default */
    position: fixed; /* Stay in place */
    z-index: 1; /* Sit on top */
    padding-top: 100px; /* Location of the box */
    left: 0;
    top: 0;
    width: 100%; /* Full width */
    height: 100%; /* Full height */
    overflow: auto; /* Enable scroll if needed */
    background-color: rgb(1,0,0); /* Fallback color */
    background-color: rgba(1,1,1,0); /* Black w/ opacity */
}

/* Modal Content (image) */
.modal-content {
    margin: auto;
    display: block;
    width: 50%;
    max-width: 200px;
}

/* Caption of Modal Image */
#caption {
    margin: auto;
    display: block;
    width: 80%;
    max-width: 700px;
    text-align: center;
    color: #ccc;
    padding: 10px 0;
    height: 150px;
    background-color: rgb(1,1,1); /* Fallback color */
    background-color: rgba(1,1,1,0); /* Black w/ opacity */
}

/* Add Animation */
.modal-content, #caption {
    -webkit-animation-name: zoom;
    -webkit-animation-duration: 0.6s;
    animation-name: zoom;
    animation-duration: 0.6s;
}

@-webkit-keyframes zoom {
    from {-webkit-transform:scale(0)}
    to {-webkit-transform:scale(1)}
}

@keyframes zoom {
    from {transform:scale(0)}
    to {transform:scale(1)}
}

/* The Close Button */
.close {
    position: absolute;
    top: 15px;
    right: 65px;
    color: #f1f1f1;
    font-size: 40px;
    font-weight: bold;
    transition: 0.3s;
}

.close:hover,
.close:focus {
    color: #bbb;
    text-decoration: none;
    cursor: pointer;
}

/* 100% Image Width on Smaller Screens */
@media only screen and (max-width: 700px){
    .modal-content {
        width: 100%;
    }
}

var modal2 = document.getElementById('myModal2');
var close = document.getElementById('ui card centered')
// Get the image and insert it inside the modal - use its "alt" text as a caption
var img = document.getElementById('myImg2');
var modalImg = document.getElementById("img01");
var captionText = document.getElementById("caption");
img.onclick = function(){
    modal2.style.display = "block";
    modalImg.src = this.src;
    captionText.innerHTML = this.alt;
}

// Get the <span> element that closes the modal
var imga = document.getElementsByClassName("ui card centered")[0];
// When the user clicks on <span> (x), close the modal
imga.onclick = function() {
    modal2.style.display = "none";
}
</script>

}

var imga = document.getElementsByClassName("modal-content")[0];

modal.onclick = function() {
    modal.style.display = "none";
}
</script>
